import * as d3 from "d3";
import {useD3} from "../hooks/useD3";

export function Map()
{
	// Language->country mapping
	// Map collection data onto map

	return (
		<div className={"map-container"}>
			<svg
				ref={ref}
				style={{
					height: "100%",
					width: "100%",
					margin: 0
				}}>
				<g className={"map-area"} />
			</svg>
		</div>
	);
}
